import { makeStyles } from '@mui/styles';


export const useStyles = makeStyles({
  root: {
    maxWidth: "100%",
    background: "#009BAD !important",
    color: "#ffffff !important",
    height: "315px",
  },
  upDiv:{
    display:"flex",
    justifyContent:"flex-end",
    paddingRight:"30px"
  },
  signPart:{
    width:"200px",
    display:"flex",
    justifyContent:"space-between"
  },
  header:{
    backgroundColor:"white",
    color:"black",
    padding
  },
  innerHead:{
    display:"flex",
    justifyContent:"space-between"
  },
  menuPart:{
    width:"400px",
    display:"flex",
    justifyContent:"space-between",
  }


});
